const Home = () => {
  return (
    <div className='h-full w-full flex justify-center items-center' >
       <nav className='w-full h-full top-0 text-center text-yellow-500 font-bold text-xl ' on>Logout</nav>
       <div className='w-full  text-red-800 font-bold text-xl'>
          Home
       </div>
    </div>
  )
}

export default Home
